import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "../Layout.css";

const API_KEY = "73d1ee267dfb5f9b6c25f3681eb3875f"; // üîë <-- L√§gg in din OpenWeatherMap API-nyckel h√§r

const lakes = [
  {
    key: "Lugnet",
    name: "Lugnet",
    lat: 59.11778189893817,
    lon: 15.232421965429385,
    rules: [
      "I Lugnet √§r det flugfiske och Catch & Release som g√§ller och man anv√§nder en hullingsl√∂s enkelkrok.",
      "Fisket f√•r forts√§tta s√• l√§nge man √•ters√§tter fisken som √§r i bra kondition.",
      "Den person som st√•r p√• fiskekortet har r√§tten att fiska i den sj√∂ som fiskekortet g√§ller.",
      "Endast ett fiskeredskap √§r till√•tet per fiskekort!",
      "Till√•tna fiskemetoder √§r endast flugfiske med hullingl√∂s enkelkrok. Endast en upph√§ngare √§r till√•tet och ryckfiske √§r f√∂rbjudet."
    ],
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "S√§bylundssj√∂n",
    name: "S√§bylundssj√∂n",
    lat: 59.16460436303601,
    lon: 15.15388129762814,
    rules: [
      "Max 2 fiskar per dag",
      "Endast mete till√•tet",
      "Fiskekort kr√§vs f√∂r all fisk"
    ],
    address: "Kommer snart, Kumla kommun"
  },
  {
    key: "Nolsj√∂n",
    name: "Nolsj√∂n",
    lat: 59.14149881510971,
    lon: 14.56810353864065,
    rules: [
      "Catch & release",
      "Ingen n√§tfiske",
      "Max 3 fiskar per dag"
    ],
    address: "Kommer snart, Kumla kommun"
  }
];

function Rules() {
  const location = useLocation();
  const [selectedLake, setSelectedLake] = useState(null);
  const [weather, setWeather] = useState(null);

  // H√§mta sj√∂ fr√•n URL eller knapptryck
  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const lakeKey = params.get("lake");
    const lake = lakes.find((l) => l.key === lakeKey);
    if (lake) {
      setSelectedLake(lake);
      fetchWeather(lake.lat, lake.lon);
    }
  }, [location]);

  // Funktion f√∂r att h√§mta v√§derdata
  const fetchWeather = async (lat, lon) => {
    try {
      const res = await fetch(
        `https://api.openweathermap.org/data/2.5/weather?lat=${lat}&lon=${lon}&units=metric&lang=sv&appid=${API_KEY}`
      );
      const data = await res.json();
      setWeather(data);
    } catch (err) {
      console.error("Fel vid h√§mtning av v√§der:", err);
    }
  };

  // N√§r anv√§ndaren klickar p√• en sj√∂
  const handleLakeClick = (lake) => {
    setSelectedLake(lake);
    setWeather(null);
    fetchWeather(lake.lat, lake.lon);
  };

  return (
    <div className="rules-container">
      <div className="outer-card">
        <h1>{selectedLake ? selectedLake.name : "V√§lj sj√∂"}</h1>

        <div className="inner-card">
          {!selectedLake && (
            <div style={{ display: "flex", gap: "10px", flexWrap: "wrap", marginBottom: "20px" }}>
              {lakes.map((lake) => (
                <button
                  key={lake.key}
                  onClick={() => handleLakeClick(lake)}
                  style={{
                    padding: "10px 15px",
                    cursor: "pointer",
                    borderRadius: "6px",
                    border: "1px solid #0077cc",
                    backgroundColor: "#fff",
                    color: "#0077cc",
                    fontWeight: "600",
                    transition: "all 0.3s",
                  }}
                  onMouseEnter={(e) => {
                    e.currentTarget.style.backgroundColor = "#0077cc";
                    e.currentTarget.style.color = "#fff";
                  }}
                  onMouseLeave={(e) => {
                    e.currentTarget.style.backgroundColor = "#fff";
                    e.currentTarget.style.color = "#0077cc";
                  }}
                >
                  {lake.name}
                </button>
              ))}
            </div>
          )}

          {selectedLake && (
            <div>
              <ul>
                <h2 style={{ fontWeight: 700, marginBottom: "16px" }}>Regler f√∂r {selectedLake.name}</h2>
                {selectedLake.rules.map((rule, index) => (
                  <li
                    key={index}
                    style={{
                      fontWeight: 600,
                      wordWrap: "break-word",
                      overflowWrap: "break-word",
                      marginBottom: "8px",
                    }}
                  >
                    {rule}
                  </li>
                ))}
              </ul>
              <p
                style={{
                  fontWeight: 700,
                  wordWrap: "break-word",
                  overflowWrap: "break-word",
                  marginTop: "12px",
                }}
              >
                Adress: {selectedLake.address}
              </p>

              {/* V√§derinformation */}
              {weather ? (
                <div className="weather-card">
                  <h3>üå§ V√§der just nu</h3>
                  <p style={{ textTransform: "capitalize" }}>
                    {weather.weather[0].description}
                  </p>
                  <p>Temperatur: {Math.round(weather.main.temp)}¬∞C</p>
                  <p>Vind: {Math.round(weather.wind.speed)} m/s</p>
                  <p>Luftfuktighet: {weather.main.humidity}%</p>
                </div>
              ) : selectedLake ? (
                <p style={{ marginTop: "10px" }}>‚è≥ H√§mtar v√§der...</p>
              ) : null}
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default Rules;
